import React from "react";
import "bulma/css/bulma.css";
import Test from "./components/Test";

const App: React.FC = () => {
  return (
    <div
      style={{
        color: "#282c34"
      }}
    >
      <Test />
      HELLO?
    </div>
  );
};

export default App;
